import React from 'react';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import { LinkContainer } from 'react-router-bootstrap'; // First, install react-router-bootstrap
import './Navbar.css';

export default function NavbarComponent() {
  return (
    <Navbar expand="lg" className="nav-container">
      <Navbar.Brand>
        <LinkContainer to="/">
          <img className="nav-brand nav-logo"
            src="/IntraTrackerLogo.png"
            alt="Logo"
          />
        </LinkContainer>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto nav">
          <LinkContainer to="/team">
            <Nav.Link>Manage Team</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/timer">
            <Nav.Link>Timer Dashboard</Nav.Link>
          </LinkContainer>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}
